import Presentation from './Presentation'
import Projects from './Projects'
import Footer from '../components/Footer'
import Swiper from './Swiper'
import './Home.css';

class Home extends Component {
render() {
	return (
	<div class="uk-width-1-1 uk-width-medium-1-2"><div class="uk-panel uk-panel-box" data-particles>
  		<h1 style="text-align: center; height: 700px; width: 100%; padding: 25%; color: red;"></h1>
		<div className="home">
			<Presentation />
			{/* <Swiper /> */}
			<Projects />
			<Footer />
		</div>
	</div>
	</div>	
	)
}}

export default Home;
